export default function HomePage() {
  return (
    Nav()
  );
}

function Nav() {
  return (
    <>
      <nav>
        <a href="index.html">Josh Ashton</a>
        <div>
          <ul>
            <a href="projects">
              <li>Projects</li>
            </a>
          </ul>
        </div>
      </nav>
    </>
  );
}

function Splash( { primaryText, secondaryText }) {
  return (
    <>
      <div>
        <h1>Hi, I'm Josh Ashton</h1>
        <h2>Junior fullstack developer</h2>
      </div>
    </>
  );
}
